import Vue from 'vue';
import ElementUI from 'element-ui'; // 使用 Element UI（Vue 2.x 版本）
import 'element-ui/lib/theme-chalk/index.css';
import App from './App.vue';
import router from './router';
import store from './store';
import axios from 'axios';

// 使用 Element UI
Vue.use(ElementUI);

// 将 axios 挂载到 Vue 原型
Vue.prototype.$axios = axios;

// 创建 Vue 实例
new Vue({
  router,
  store,
  render: h => h(App),
}).$mount('#app');
